INSERT INTO `artists` VALUES (1,'Rolling Stones',1,'The Rolling Stones are an English rock band formed in London in 1962.'),(2,'Jimi Hendrix',2,'James Marshall Hendrix was an American guitarist, singer and songwriter.'),(3,'Jefferson Airplane',3,'Jefferson Airplane was a psychedelic rock band from San Francisco. They were formed in 1965.'),(4,'The Beatles',4,'The Beatles were an English rock band, started in Liverpool, England in 1960. The members of the band were John Lennon, Paul McCartney, George Harrison, and Ringo Starr.'),(5,'Led Zeppelin',5,'Led Zeppelin were an English rock band. The members were Robert Plant (vocals), Jimmy Page (lead guitar), John Paul Jones (bass), and John Bonham (drums). '),(6,'Fleetwood Mac',6,'Fleetwood Mac are a British-American rock band that formed in London, England in 1967.'),(7,'Elvis Presley',7,'Elvis Aaron Presley was an American singer, musician and actor. He is often regarded as the most influential and most famous musician of the 20th century, and is widely regarded as a cultural icon.'),(8,'Pearl Jam',8,'Pearl Jam is an American rock band formed in 1990 in Seattle, Washington. The bands lineup consists of founding members Jeff Ament (bass guitar), Stone Gossard (rhythm guitar), Mike McCready (lead guitar), and Eddie Vedder (lead vocals, guitar), as well as Matt Cameron (drums)'),(9,'The Beach Boys',9,'The Beach Boys are an American rock band formed in Hawthorne, California in 1961. The groups original lineup consisted of brothers Brian, Dennis, and Carl Wilson, their cousin Mike Love, and friend Al Jardine. '),(10,'Bob Dylan',10,'Bob Dylan (born Robert Allen Zimmerman, May 24, 1941) is an American singer-songwriter, author and visual artist. Widely regarded as one of the greatest songwriters of all time, Dylan has been a major figure in popular culture for more than 50 years.'),(11,'Tom Petty and the Heartbreakers',11,'Tom Petty and the Heartbreakers was an American rock band from Gainesville, Florida. Formed in 1976, the band originally comprised Tom Petty (lead singer, guitar), Mike Campbell (lead guitarist), Ron Blair (bass guitar), Stan Lynch (drums), and Benmont Tench (keyboards). '),(12,'Johnny Cash',12,'John R. Cash (born J. R. Cash; February 26, 1932 – September 12, 2003) was an American singer, songwriter, musician, and actor.'),(13,'Ray Charles',13,'Ray Charles Robinson (September 23, 1930 – June 10, 2004) was an American singer, songwriter, pianist, and composer.'),(14,'David Bowie',14,'David Robert Jones (8 January 1947 – 10 January 2016), known professionally as David Bowie, was an English singer-songwriter and actor. He was a leading figure in the music industry and is regarded as one of the most influential musicians of the 20th century. '),(15,'Stevie Wonder',15,'Stevland Hardaway Morris (né Judkins; born May 13, 1950), known professionally as Stevie Wonder, is an American singer, songwriter, musician and record producer. A prominent figure in popular music during the second half of the 20th century, Wonder is one of the most successful songwriters and musicians. '),(16,'Prince',16,'Prince Rogers Nelson (June 7, 1958 – April 21, 2016) was an American singer-songwriter, musician, record producer, dancer, and actor. He is widely regarded as one of the greatest musicians of his generation.'),(17,'The Kinks',17,'Robert Nesta Marley, OM (6 February 1945 – 11 May 1981) was a Jamaican singer, songwriter, and musician. Considered one of the pioneers of reggae, his musical career was marked by fusing elements of reggae, ska, and rocksteady, as well as his distinctive vocal and songwriting style.'),(18,'Aretha Franklin',18,'Aretha Louise Franklin (March 25, 1942 – August 16, 2018) was an American singer, songwriter, actress, pianist, and civil rights activist.'),(19,'The Who',19,'The Who are an English rock band formed in London in 1964. Their classic lineup consisted of lead singer Roger Daltrey, guitarist and singer Pete Townshend, bass guitarist and singer John Entwistle, and drummer Keith Moon. '),(20,'Chuck Berry',20,'Charles Edward Anderson Berry (October 18, 1926 – March 18, 2017) was an American singer, songwriter and guitarist, and one of the pioneers of rock and roll music.'),(21,'Eric Clapton',21,'Eric Patrick Clapton, CBE (born 30 March 1945) is an English rock and blues guitarist, singer, and songwriter.'),(22,'Simon & Garfunkel',22,'Simon & Garfunkel were an American folk-rock duo consisting of singer-songwriter Paul Simon and singer Art Garfunkel. One of the best-selling music groups of the 1960s'),(23,'The Velvet Underground',23,'The Velvet Underground was an American rock band formed in New York City in 1964 by singer/guitarist Lou Reed, multi-instrumentalist John Cale, guitarist Sterling Morrison, and drummer Angus MacLise. '),(24,'Michael Jackson',24,'Michael Joseph Jackson (August 29, 1958 – June 25, 2009) was an American singer, songwriter, and dancer. Dubbed the \"King of Pop\", he is regarded as one of the most significant cultural figures of the 20th century. Through stage and video performances, he popularized complicated dance techniques such as the moonwalk, to which he gave the name, and the robot.'),(25,'The Black Angels',25,'The Black Angels are an American psychedelic rock band from Austin, Texas.'),(26,'The Doors',26,'The Doors were an American rock band formed in Los Angeles in 1965, with vocalist Jim Morrison, keyboardist Ray Manzarek, guitarist Robby Krieger, and drummer John Densmore. '),(27,'Joy Division',27,'Joy Division were an English rock band formed in Salford in 1976. The group consisted of vocalist Ian Curtis, guitarist/keyboardist Bernard Sumner, bassist Peter Hook and drummer Stephen Morris.'),(28,'Fontaines D.C.',28,'Fontaines D.C. are an Irish post-punk revival band formed in Dublin in 2017.The band consists of Grian Chatten (vocals), Carlos O\'Connell (guitar), Conor Curley (guitar), Conor Deegan III (bass), and Tom Coll (drums).'),(29,'Janis Joplin',29,'Janis Lyn Joplin (January 19, 1943 – October 4, 1970) was an American singer-songwriter who sang rock, soul and blues music. One of the most successful and widely known rock stars of her era, she was noted for her powerful mezzo-soprano vocals and \"electric\" stage presence.'),(30,'Kyuss',30,'Kyuss was an American rock band, formed in Palm Desert, California in 1987. The band disbanded in 1995, and since then, members of Kyuss have gone on to form or play in several notable bands including Queens of the Stone Age, Fu Manchu, Dwarves, Eagles of Death Metal, Mondo Generator, Hermano, Unida, Slo Burn and Them Crooked Vultures.'),(31,'Queens of the Stone Age',31,'Queens of the Stone Age (commonly abbreviated QOTSA) is an American rock band formed in 1996 in Palm Desert, California. The band was founded by vocalist and guitarist Josh Homme, who has been the only constant member throughout multiple line-up changes. The current line-up consists of Homme alongside Troy Van Leeuwen (guitar, lap steel, keyboard, percussion, backing vocals), Michael Shuman (bass guitar, keyboard, backing vocals), Dean Fertita (keyboards, guitar, percussion, backing vocals), and Jon Theodore (drums, percussion).'),(32,'Metallica',32,'Metallica is an American heavy metal band. The band was formed in 1981 in Los Angeles by vocalist/guitarist James Hetfield and drummer Lars Ulrich, and has been based in San Francisco for most of its career.'),(33,'Amy Winehouse',33,'Amy Jade Winehouse (14 September 1983 – 23 July 2011) was an English singer and songwriter. She was known for her deep, expressive contralto vocals and her eclectic mix of musical genres, including soul, rhythm and blues and jazz.'),(34,'Heart',34,'Heart is an American rock band formed in 1970 in Seattle, Washington, by Steve Fossen (bass guitar), Roger Fisher (guitar), David Belzer (keyboards), and Jeff Johnson (drums). It evolved from an existing band, White Heart. The vocalists for Heart are sisters Ann Wilson (lead vocals, flute, guitar) and Nancy Wilson (vocals, guitar, mandolin).'),(35,'The Cranberries',35,'The Cranberries were an Irish rock band formed in Limerick, Ireland, in 1989 by lead singer Niall Quinn, guitarist Noel Hogan, bassist Mike Hogan, and drummer Fergal Lawler. Quinn was replaced as lead singer by Dolores O\'Riordan in 1990. The band officially classified themselves as an alternative rock group, but incorporated aspects of indie pop, post-punk, folk rock, and pop rock into their sound.'),(36,'Adele',36,'Adele Laurie Blue Adkins MBE (born 5 May 1988), is an English singer-songwriter.'),(37,'Alicia Keys',37,'Alicia Augello Cook (born January 25, 1981), known professionally as Alicia Keys, is an American singer-songwriter. A classically-trained pianist, Keys began composing songs by age 12 and was signed at 15 years old by Columbia Records. '),(38,'Evanescence',38,'Evanescence is an American rock band founded in Little Rock, Arkansas, in 1995 by singer and pianist Amy Lee and guitarist Ben Moody. After recording independent albums, the band released their first full-length album, Fallen, on Wind-up Records in 2003.'),(39,'Lana Del Rey',39,'Elizabeth Woolridge Grant (born June 21, 1985), known by her stage name Lana Del Rey, is an American singer-songwriter. Her music is noted for its stylized, cinematic quality; themes of sadness, tragic romance, glamor, and melancholia; and references to pop culture, particularly 1950s and 1960s Americana.'),(40,'Blondie',40,'Blondie is an American rock band co-founded by singer Debbie Harry and guitarist Chris Stein. The band were pioneers in the American punk and then the new wave scene of the mid-1970s in New York. ');
