CREATE TABLE `users` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `firstname` varchar(20) DEFAULT NULL COMMENT 'Имя пользователя',
  `lastname` varchar(20) DEFAULT NULL COMMENT 'Фамилия пользователя',
  `email` varchar(50) DEFAULT NULL COMMENT 'Электронная почта',
  `gender` char(10) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `loginname` varchar(30) DEFAULT NULL COMMENT 'Короткое имя или никнейм пользователя',
  `pass` char(20) DEFAULT NULL COMMENT 'Пароль',
  `birthday` date DEFAULT NULL,
  `country` varchar(40) DEFAULT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`),
  KEY `phone_2` (`phone`),
  KEY `email_2` (`email`),
  KEY `loginname` (`loginname`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
